import React, { useState, useEffect } from "react";
import getPokemons from "./GetPokemons";

const AllPokemons = () => {
  const [pokemons, setPokemons] = useState([]);
};

useEffect(() => {
  getPokemons().then((data) => {
    setPokemons(data);
  });
}, []);

export default AllPokemons;
